import { Route, Routes, Redirect, withRouter, BrowserRouter } from 'react-router-dom';
import { Login } from './pages/Login';
import { SignUp } from './pages/SignUp';


function App() {

  const route = (
    <Routes>
      <Route path="/login" component={Login} />
      <Route path="/signup" component={SignUp} />
    </Routes>
  )



  return (
    <BrowserRouter>
      <div className="App">
        {route}
      </div>
    </BrowserRouter>

  );
}

export default App;
